import React from 'react';
const Contact=()=>{
   
    return(

        <>
            <div className="setStyle2">
                <h1>Contact Page.....</h1>
                <form>
                    <label>Name : </label><input type="text" placeholder="Enter Your Name" />
                    <label>Mobile Number : </label><input type="number" placeholder="Enter Your Mobile Number" />

                </form>
             
                
            </div>
        </>
    )
}
export default Contact;
